Dashmix.onLoad(
  class {
    static initValidation() {
      Dashmix.helpers("jq-validation"),
        jQuery(".js-validation-lock").validate({
          rules: { "lock-password": { required: !0, minlength: 3 } },
          messages: {
            "lock-password": { required: "Please enter your valid password" },
          },
        });
    }
    static init() {
      this.initValidation();
    }
  }.init()
);
